조리순서:
[{'step_number': 1, 'description': '재료를 준비해주세요~.', 'image_url': 'https://recipe1.ezmember.co.kr/cache/recipe/2018/12/18/cdbdf897e4cb222b237a2d9adc31c83c1.jpg'}, {'step_number': 2, 'description': '계란흰자에 설탕 40g만 먼저 넣고 2분정도 거품을 내주세요~.', 'image_url': 'https://recipe1.ezmember.co.kr/cache/recipe/2018/12/18/c3a4e226d8fcdfe0ad58cb094ca22bd61.jpg'}, {'step_number': 3, 'description': '흰자 거품이 올라왔다면 나머지 설탕을 마저 넣어준뒤 머랭을 80%정도까지 올려주세요~.
(80%는 휘핑기를 들어올렸을때 머랭이 대롱대롱 떨어질랑말랑 매달려있는 상태랍니다~!!)', 'image_url': 'https://recipe1.ezmember.co.kr/cache/recipe/2018/12/18/859c803639bd7f7dbd62df3988728cbd1.jpg'}, {'step_number': 4, 'description': '식용색소를 원하는 만큼 넣어주세요~.
(색소를 생략하실분들은 3번단계에서 머랭을 단단하게 올려주시면 된답니다~!!', 'image_url': 'https://recipe1.ezmember.co.kr/cache/recipe/2018/12/18/175b5b35f1fca981a606b1a2871277741.jpg'}, {'step_number': 5, 'description': '머랭의 뿔이 뾰족하고 믹싱볼을 뒤집었을때 안떨어질때까지 단단하게 머랭을 만들어주세요~.', 'image_url': 'https://recipe1.ezmember.co.kr/cache/recipe/2018/12/18/c1647ca8149596668a80ce3d1a4b35251.jpg'}, {'step_number': 6, 'description': '아몬드파우더와 슈가파우더를 체에 쳐주세요~.', 'image_url': 'https://recipe1.ezmember.co.kr/cache/recipe/2018/12/18/65c301d760f68afa335a1d818a5a63a51.jpg'}, {'step_number': 7, 'description': '주걱으로 가루가 안보일때까지만 가르듯이 살짝 섞어주세요~.', 'image_url': 'https://recipe1.ezmember.co.kr/cache/recipe/2018/12/18/31a41ab1c3fc2c1541e5e15ba28c22a91.jpg'}, {'step_number': 8, 'description': '가루가 안보인다면 마카로나쥬를 할건데요~!! 마카로나쥬는 머랭거품을 삭히면서 하는거에요~!! 고무주걱을 들어올렸을때 반죽이 계단모양으로 접히면서 모양유지를 할때까지 반죽을 빙글빙글 돌려주세요~.', 'image_url': 'https://recipe1.ezmember.co.kr/cache/recipe/2018/12/18/89fc39e0cb673db0a7cc7ad8643907a31.jpg'}, {'step_number': 9, 'description': '마카롱 꼬끄 반죽을 짤주머니에 담아주세요~.', 'image_url': 'https://recipe1.ezmember.co.kr/cache/recipe/2018/12/18/e0f07c6ed0bef65c1fb47f5ede698bee1.jpg'}, {'step_number': 10, 'description': '마카롱 꼬끄 반죽을 짜준뒤 건조한 곳에서 말려주세요~.(말리는 시간은 그때그때 날씨에 따라서 달라진답니다~!!)', 'image_url': 'https://recipe1.ezmember.co.kr/cache/recipe/2018/12/18/93ab9a515a21e30c718aa65e5ed6a9ab1.jpg'}, {'step_number': 11, 'description': '손으로 중간을 만졌을때 묻어나오지않고 반죽에 광택이없으면 잘 마른거에요~!!', 'image_url': 'https://recipe1.ezmember.co.kr/cache/recipe/2018/12/18/77c8d40d5083d11fa81e871e783a20da1.jpg'}, {'step_number': 12, 'description': '135도의 오븐에서 12~13분정도 
구워준뒤 식혀주세요~.오븐', 'image_url': 'https://recipe1.ezmember.co.kr/cache/recipe/2018/12/18/f1603611d3c587d243eeb7fdc376239d1.jpg'}, {'step_number': 13, 'description': '바나나잼과 앙글레스 버터크림을 섞어주세요~.
@6902239 -앙글레즈버터크림만들기
@6902068 -바나나잼만들기', 'image_url': 'https://recipe1.ezmember.co.kr/cache/recipe/2018/12/18/188a6aca5433f3fe534757e4495429d21.jpg'}, {'step_number': 14, 'description': '짤주머니에 마카롱필링을 담아주세요~.', 'image_url': 'https://recipe1.ezmember.co.kr/cache/recipe/2018/12/18/9079a5b1a2bf42b30f3d63c1202a87201.jpg'}, {'step_number': 15, 'description': '잘식은 마카롱꼬끄에 필링을 짜주세요~.', 'image_url': 'https://recipe1.ezmember.co.kr/cache/recipe/2018/12/18/606ef622125a2caeee3c1aba36f86d3d1.jpg'}, {'step_number': 16, 'description': '저는 가운데에 바나나잼을 더 넣어서 바나나맛을 극대화시켰답니다~!!', 'image_url': 'https://recipe1.ezmember.co.kr/cache/recipe/2018/12/18/52ee4ffdfd2d99133141d044c29872971.jpg'}, {'step_number': 17, 'description': '샌드해주면 달콤하고 쫀득한 바나나마카롱 완성입니당~!!♡♡♡', 'image_url': 'https://recipe1.ezmember.co.kr/cache/recipe/2018/12/18/2c3eb762ac8c7619d73392257ca364411.jpg'}]
